// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/// @title Attendance - Basic student attendance verification
/// @notice Simple on-chain attendance system: owner (school) can appoint teacher(s); teachers register students and mark attendance per-day. Anyone can verify attendance.
contract Attendance {
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "only owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "zero address");
        owner = newOwner;
    }

    // --- Roles: teachers ---
    mapping(address => bool) public isTeacher;
    event TeacherAdded(address indexed teacher);
    event TeacherRemoved(address indexed teacher);

    function addTeacher(address teacher) external onlyOwner {
        require(teacher != address(0), "zero address");
        isTeacher[teacher] = true;
        emit TeacherAdded(teacher);
    }

    function removeTeacher(address teacher) external onlyOwner {
        delete isTeacher[teacher];
        emit TeacherRemoved(teacher);
    }

    // --- Student registry ---
    struct Student {
        string studentId; // e.g., roll number
        address wallet;   // optional wallet mapping
        uint256 registeredAt;
    }

    mapping(string => Student) private students; // studentId -> Student
    event StudentRegistered(string indexed studentId, address indexed wallet, uint256 ts);

    /// @notice Register a student (teacher or owner)
    function registerStudent(string calldata studentId, address wallet) external {
        require(isTeacher[msg.sender] || msg.sender == owner, "not authorized");
        Student storage s = students[studentId];
        if (s.registeredAt == 0) {
            s.studentId = studentId;
            s.wallet = wallet;
            s.registeredAt = block.timestamp;
            emit StudentRegistered(studentId, wallet, block.timestamp);
        } else {
            // allow updating wallet address
            s.wallet = wallet;
        }
    }

    function getStudent(string calldata studentId) external view returns (string memory, address, uint256) {
        Student memory s = students[studentId];
        return (s.studentId, s.wallet, s.registeredAt);
    }

    function isRegistered(string calldata studentId) public view returns (bool) {
        return students[studentId].registeredAt != 0;
    }

    // --- Attendance ---
    // We'll store attendance keyed by studentId => dayKey => bool
    // dayKey: use UTC date in YYYYMMDD format provided by the caller (uint256), or use epoch day
    mapping(string => mapping(uint256 => bool)) private attendance;
    mapping(string => mapping(uint256 => uint256)) private attendanceTs; // timestamp when marked

    event AttendanceMarked(string indexed studentId, uint256 indexed dayKey, address indexed markedBy, uint256 ts, bool present);

    /// @notice Mark attendance for a student on a specific dayKey. Only teachers or owner can mark.
    /// @param studentId student identifier (string, e.g., "S1234")
    /// @param dayKey date encoded as YYYYMMDD (e.g., 20251120 for Nov 20, 2025) or any agreed-upon uint
    /// @param present true = present, false = absent
    function markAttendance(string calldata studentId, uint256 dayKey, bool present) external {
        require(isTeacher[msg.sender] || msg.sender == owner, "not authorized");
        require(isRegistered(studentId), "student not registered");
        attendance[studentId][dayKey] = present;
        attendanceTs[studentId][dayKey] = block.timestamp;
        emit AttendanceMarked(studentId, dayKey, msg.sender, block.timestamp, present);
    }

    /// @notice Anyone can check if a student was present on a given dayKey
    function isPresent(string calldata studentId, uint256 dayKey) external view returns (bool, uint256) {
        return (attendance[studentId][dayKey], attendanceTs[studentId][dayKey]);
    }

    /// @notice Get attendance for a list of dayKeys (useful for UI)
    function batchIsPresent(string calldata studentId, uint256[] calldata dayKeys) external view returns (bool[] memory, uint256[] memory) {
        uint256 n = dayKeys.length;
        bool[] memory pres = new bool[](n);
        uint256[] memory ts = new uint256[](n);
        for (uint256 i = 0; i < n; i++) {
            pres[i] = attendance[studentId][dayKeys[i]];
            ts[i] = attendanceTs[studentId][dayKeys[i]];
        }
        return (pres, ts);
    }

    // --- convenience: student self-check-in (optional) ---
    // Allows a student to self-mark attendance only if their wallet matches registered wallet.
    function selfCheckIn(string calldata studentId, uint256 dayKey, bool present) external {
        Student memory s = students[studentId];
        require(s.registeredAt != 0, "student not registered");
        require(s.wallet == msg.sender, "wallet mismatch");
        attendance[studentId][dayKey] = present;
        attendanceTs[studentId][dayKey] = block.timestamp;
        emit AttendanceMarked(studentId, dayKey, msg.sender, block.timestamp, present);
    }
}

